import { TableMain } from "../style/table";

const Table = (data, column) => {
  return (
    <div>
      <TableMain>
        <thead>
          <tr>
            <th>Id</th>
            <th>title</th>
            <th>Category</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row) => (
            <td>
              <tr>{row.id}</tr>
              <tr>{row.title}</tr>
              <tr>{row.categoory}</tr>
            </td>
          ))}
        </tbody>
      </TableMain>
    </div>
  );
};

export default Table;
